import React from 'react';
import sdata from './Sdata';
import Cards from './cards'

const favS = prompt("Enter Your Streaming Platform");

function Series() {

    if (favS === 'netflix') {
        return (
            <Cards
                imgsrc={sdata[1].imgsrc}
                title={sdata[1].title}
                sname={sdata[1].sname}
                links={sdata[1].links}
            />,
            <Cards
                imgsrc={sdata[0].imgsrc}
                title={sdata[0].title}
                sname={sdata[0].sname}
                links={sdata[0].links}
            />,
            <Cards
                imgsrc={sdata[4].imgsrc}
                title={sdata[4].title}
                sname={sdata[4].sname}
                links={sdata[4].links}
            />,
            <Cards
                imgsrc={sdata[5].imgsrc}
                title={sdata[5].title}
                sname={sdata[5].sname}
                links={sdata[5].links}
            />
        )
    }
    else {
        return (
            <Cards
                imgsrc={sdata[2].imgsrc}
                title={sdata[2].title}
                sname={sdata[2].sname}
                links={sdata[2].links}
            />,
            <Cards
                imgsrc={sdata[3].imgsrc}
                title={sdata[3].title}
                sname={sdata[3].sname}
                links={sdata[3].links}
            />
        )
    }
}

const App = () => (
    <>
        <h1 className="heading">List of Best Five Netflix Webseries</h1>
        <Series />
    </>
);

export default App;
